import React from 'react';
import s from "./../Dialogs.module.css";

const Message = (props) => {

    let mes

    if(props.author){
        message += 'me';
    }else{
        message += 'other';
    }

    return (
        <div className={s.message}>{props.message}</div>
    );
}

export default Message;
